import { Routes, Route } from 'react-router-dom';
import MyPageCategory from '../component/myPage_category';
import MyPageHeader from '../component/myPage_header';
import MyPageMenu from '../component/myPage_menu';
import SizeGuidePage from '../sizeGuide/sizeGuidePage';

function SizeGuide() {
  return (
    <div>
      <Routes>
        <Route path="/mypage/category" element={<MyPageCategory />} />
        <Route path="/mypage/header" element={<MyPageHeader />} />
        <Route path="/mypage/menu" element={<MyPageMenu />} />
        <Route path="/size-guide" element={<SizeGuidePage />} />
      </Routes>
    </div>
  );
}

export default SizeGuide;
